function dettakommeraldrighända() {

  let totalt = " ";
  for (var i = 0; i < document.querySelectorAll("div.Product-Puff").length; i++) {
    let innehåll = " ";
    var mellanDel = "!!"
    var mellanKak = "??"
    var mellanInne = "--"

    var img = document.querySelectorAll("div.Product-Puff")[i].querySelector("img").src;
    var name = document.querySelectorAll("div.Product-Puff")[i].querySelector("div.Product-Puff > div > h2 > a").innerText;
    var amount = document.querySelectorAll("div.Product-Puff")[i].querySelector(".Amount").innerText.split("Antal: ")[1];
    var weight = document.querySelectorAll("div.Product-Puff")[i].querySelector(".Weight").innerText.split("Vikt: ")[1];
    var des = document.querySelectorAll("div.Product-Puff")[i].querySelector(".Product-Introtext").innerText;
    var ingr = document.querySelectorAll("div.Product-Ingredients--Wrapper")[i].querySelectorAll(".Normal")[1].innerHTML;
    var närings = document.querySelectorAll("div.Product-Ingredients--Wrapper")[i].querySelector("div.Nutritional-Info > table > tbody").innerHTML.replace(/ g/g, " g").replace(/kcal/g, "kcal");
    var color = document.querySelectorAll("div.Product-Puff")[i].querySelector(".Product-Price").style.backgroundColor;


  for (var j = 0; j < document.querySelectorAll("div.Product-Ingredients--Wrapper")[i].querySelectorAll(".Allergy-InfoList li span").length; j++) {
    innehåll += document.querySelectorAll("div.Product-Ingredients--Wrapper")[i].querySelectorAll(".Allergy-InfoList li span")[j].title.replace(/Produkten /g, "").replace(/kan innehålla spår av/g, "spårav").replace(/innehåller inte/g, "inte")  +  mellanInne;
  }


   var denkakan = name + mellanDel + img + mellanDel + amount + mellanDel + weight + mellanDel + des + mellanDel + innehåll + mellanDel + närings + mellanDel + ingr + mellanDel + color;
   totalt += denkakan + mellanKak;
  }
  console.log(encodeURI(totalt));



}
